import { Component } from "@angular/core";

@Component({
    selector: "navbar",
    styleUrls: ["navbar.scss"],
    template: `
            <header>
                <nav>
                    <div class="container">
                        <div></div>
                        <div></div>
                    </div>
                </nav>
            </header>
    `
})

export class Navbar{}
